import React from "react";
import { Link } from "react-router-dom";

const LoginNav = ({ setAddTask }) => {
  const handleAddTask = (e) => {
    if (e.target.click) {
      setAddTask((prev) => !prev);
    }
  };

  return (
    <div className="navbar p-10">
      <div className="navbar-header align-items: flex-start">
        <h1 className="text-primary text-4xl font-bold">Workout Buddy</h1>
      </div>
    </div>
  );
};

export default LoginNav;
